import { useState } from "react";
import styled from "styled-components";

const Wrapper = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
`
const Form = styled.form`
    width: 500px;
    display: grid;
    flex-direction: column;
    gap: 10px;
`
const Title = styled.h1`
`
const Input = styled.input`
`
const Label = styled.label`
`
export default function CreateAccount(){
    const [uploading, setUploading] = useState("계정 만들기")
    return(
        <Wrapper>
            <Form>
                <Title>createAccount</Title>
                <Input type="text" name="" placeholder="이름을 입력해주세요."/>
                <Input type="email" name="email" placeholder="E-mail을 입력해주세요."/>
                <Input type="password" name="password" placeholder="사용할 비밀번호를 입력해주세요."/>
                <Input type="text" placeholder="사용하실 닉네임을 입력해주세요."/>
                <Label/>
                <Input id=""/>
                <Input type="submit" value={uploading}/>
            </Form>
        </Wrapper>
    );
}
